import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import {
  FaFacebook,
  FaTwitter,
  FaInstagram,
  FaYoutube,
  FaPinterest,
  FaLinkedin,
  FaGithub,
} from "react-icons/fa";
export default function Footer() {
  return (
    <>
      <FooterWrapper>
        <FooterContainer>
          <FooterUP>
            <img
              src="/assets/main_Sortcoder.png"
              alt="logo"
              height="25px"
              style={{
                marginTop: "36px",
              }}
            ></img>
            <FooterLinks>
              {Footerdata.map((data, key) => (
                <LinksWrapper key={key}>
                  <strong>{data.title}</strong>
                  {data.links.map((link) => (
                    <FLinks>{link}</FLinks>
                  ))}
                </LinksWrapper>
              ))}
            </FooterLinks>
          </FooterUP>
          <FooterDOWN>
            <div>
              Â© {new Date().getFullYear()} SortCoder, Inc. All Rights Reserved.
            </div>
            <div>
              <SocialLink>
                <FaFacebook size={25} />
              </SocialLink>
              <SocialLink>
                <FaTwitter size={25} />
              </SocialLink>
              <SocialLink>
                <FaInstagram size={25} />
              </SocialLink>
              <SocialLink>
                <FaYoutube size={25} />
              </SocialLink>
              <SocialLink>
                <FaPinterest size={25} />
              </SocialLink>
              <SocialLink>
                <FaLinkedin size={25} />
              </SocialLink>

              <SocialLink>
                <FaGithub size={25} />
              </SocialLink>
            </div>
          </FooterDOWN>
        </FooterContainer>
      </FooterWrapper>
    </>
  );
}

const FooterWrapper = styled.div`
  background-color: #040e18;
`;

const FooterContainer = styled.div`
  /* background-color: #fff; */
  margin: 0 auto;
  width: 1172px;
  padding-bottom: 48px;
`;
const FooterUP = styled.div`
  display: flex;
  padding-left: 16px;
  padding-right: 16px;
  padding-bottom: 16px;
  padding-top: 64px;
`;
const FooterLinks = styled.div`
  display: flex;
  padding-left: 64px;
`;
const LinksWrapper = styled.div`
  display: flex;
  flex-direction: column;
  text-align: left;
  padding: 0 28px;

  strong {
    text-transform: uppercase;
    font-size: 16px;
    padding-bottom: 16px;
    padding-top: 36px;
    color: #fff;
    letter-spacing: 2px;
    line-height: 1.2;
  }
`;
const FLinks = styled(Link)`
  color: #fff;
  padding: 9px 0;
  opacity: 0.75;
`;
const FooterDOWN = styled.div`
  padding-top: 64px;
  display: flex;
  justify-content: space-between;
  div {
    color: #fff;
  }
`;
const SocialLink = styled(Link)`
  margin-right: 20px;
  margin-top: 8px;
  color: #fff;
  align-items: center;
  transition: 0.4s ease-in-out;
  :hover {
    /* opacity: 0.85; */
    color: #7933fc;
    transition: 0.3s ease-in-out;
  }
`;
const Footerdata = [
  {
    title: "Resources",
    links: ["Blog", "Experts", "Articles", "Examples", "Roadmap!"],
  },
  {
    title: "Learn",
    links: ["Python", "Data Analysis"],
  },

  {
    title: "Company",
    links: [
      "Home",
      "About",
      "Blog",
      "Support",
      "Youtube",
      "Terms & Conditions",
    ],
  },
  {
    title: "Apps",
    links: ["Coming Soon!"],
  },
];
